import './App.css';
import {ChakraProvider, extendTheme} from "@chakra-ui/react";
//import {BrowserRouter, Route, Routes} from 'react-router-dom';
//import Homepage from './components'


function App() {
  const theme = extendTheme({
    palette:{mode:"dark"},
  });
  return(
    <ChakraProvider theme={theme}>
      <div className='App'>
        <h1>MSD Workshop</h1>
      </div>
    </ChakraProvider>
  )
}

export default App;
